import React from 'react';
import './Programs.css';

export const Programs = () => {
  return (
    <div className="Programs" id="programs">
      <div className="programs-header">
        <span className="stroke-text">Explore</span>
        <span>Programs</span>
        <span className="stroke-text">to shape you</span>
      </div>
    </div>
  );
};
